import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './pages/Home';


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/' component={Home}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
